import '../SCSS/home.css'
export function Links() {
    return (
        <ul className="Links">
            <li><a className="active" href="">Home</a></li>
            <li><a href="">About</a></li>
            <li><a href="">Works</a></li>
            <li><a href="">Contact</a></li>
        </ul>
    )
}
